import React from 'react';

const Menu = () => {
    return (
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Navbar.Brand href="/">NYOUS</Navbar.Brand>
            
        </Navbar>
    )
}

export default Menu;
